pub enum Closure<A> {
    Headless {
        f: HeadlessClosureId,
    },
    Fn {
        f: Rc<Fn(A) -> ()>,
    },
    FnMut {
        f: Rc<RefCell<FnMut(A) -> ()>>,
    },
}

pub enum ImageEncodedData<'a> {
    Bytes {
        format: ImageEncodingFormat,
        bytes: &'a Rc<Vec<u8>>,
    },
    DataUri {
        data_uri: &'a Rc<String>,
    },
}

pub enum FontEncodedData<'a> {
    Bytes {
        bytes: &'a Rc<Vec<u8>>,
    },
    DataUri {
        data_uri: &'a Rc<String>,
    },
}
